import React from 'react'
import {ListGroupItem} from 'reactstrap'
function ExpenseItem({ item }) {
    return (
        <ListGroupItem>
        <div className="float-stat">left</div>
        <div className="float-end">right</div>
        </ListGroupItem>
    )
}

export { ExpenseItem }
